import React from 'react';

const styles = {
  container: {
    textAlign: 'center',
    padding: '20px',
    fontFamily: 'Arial, sans-serif',
    color: 'white',
    background: 'linear-gradient(135deg, #000000, #000000)',
    minHeight: '100vh',
  },
  list: {
    textAlign: 'left',
    margin: '20px auto',
    maxWidth: '600px',
    color: '#ddd',
  },
};

function FoodRecommendation() {
  return (
    <div style={styles.container}>
      <header>
        <h2>Food Recommendations</h2>
        <p>Based on your skin condition, here are some dietary recommendations:</p>
        <ul style={styles.list}>
          <li>Include more fruits and vegetables in your diet.</li>
          <li>Stay hydrated by drinking plenty of water.</li>
          <li>Avoid processed and sugary foods.</li>
          <li>Incorporate foods rich in omega-3 fatty acids, like fish and nuts.</li>
        </ul>
      </header>
    </div>
  );
}

export default FoodRecommendation;
